import React from "react";
import "./App.css";
import Header from "./Header";
import CardHospedagem from "./CardHospedagem"
import Footer from "./Footer";

function criarCard(emojipedia) {
  return (
    <Card
      key={emojipedia.id}
      emoji={emojipedia.emoji}
      name={emojipedia.name}
      meaning={emojipedia.meaning}
    />
  );
}

function App() {
  return (
    <div className="App">
      <Header />
      <h1>Hospedagens</h1>
      <CardHospedagem />
      <CardHospedagem />
      <Footer />
    </div>
  );
}

export default App;
